import React from 'react';
import ListGroup from 'react-bootstrap/ListGroup';

const ServiceList = () => {
  const services = [
    {
      icon: "https://dashboard.codeparrot.ai/api/image/Z7kBNVCHtJJZ6v_o/vuesax-b.png",
      title: "Best price guaranteed",
      description: "Find a lower price? We'll refund you 100% of the difference."
    },
    {
      icon: "https://dashboard.codeparrot.ai/api/image/Z7kBNVCHtJJZ6v_o/vuesax-b-2.png",
      title: "Experience driver",
      description: "Don't have driver? Don't worry, we have many experienced driver for you."
    },
    {
      icon: "https://dashboard.codeparrot.ai/api/image/Z7kBNVCHtJJZ6v_o/vuesax-b-3.png",
      title: "24 hour car delivery",
      description: "Book your car anytime and we will deliver it directly to you."
    },
    {
      icon: "https://dashboard.codeparrot.ai/api/image/Z7kBNVCHtJJZ6v_o/vuesax-b-4.png",
      title: "24/7 technical support",
      description: "Have a question? Contact Rentcars support any time when you have problem."
    }
  ];

  return (
    <div className="container py-4">
      {/* Header Section */}
      <div className="mb-5">
        <div className="d-inline-block px-4 py-2 rounded-2" style={{backgroundColor: '#1572d31a'}}>
          <span className="fw-bold" style={{color: '#1572d3', fontSize: '14px'}}>НАШИТЕ ОСЛУГИ</span>
        </div>
        <h2 className="mt-4 fw-medium" style={{fontSize: '32px', color: '#333333'}}>
          Ние предлагаме най-качествените ослуги на пазара!
        </h2>
      </div>

      {/* Services List */}
      <ListGroup>
        {services.map((service, index) => (
          <ListGroup.Item key={index} className="d-flex align-items-start gap-4 border-0">
            <div className="p-3 rounded-3" style={{backgroundColor: '#ecf5ff', width: '64px', height: '64px'}}>
              <img 
                src={service.icon} 
                alt={service.title}
                className="img-fluid"
                style={{width: '24px', height: '24px'}}
              />
            </div>
            <div>
              <h3 className="fw-medium mb-1" style={{fontSize: '20px'}}>{service.title}</h3>
              <p className="text-secondary mb-0" style={{fontSize: '16px'}}>{service.description}</p>
            </div>
          </ListGroup.Item>
        ))}
      </ListGroup>
    </div>
  );
};

export default ServiceList;
